import React from "react";
import Button from "./Button";

export default class LoginForm extends React.Component {
  constructor() {
    super();
    this.state = {};
  }

  render() {
    return <div>
      <input className="button" type='name' placeholder="Nick"></input>
      <input className="button" type='password' placeholder="Password"></input>
      <input className="button" type='password' placeholder="Re-enter Password"></input>
      <Button>Submit</Button>
    </div>;
  }
}
